import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{
  render(){
    return(
      <div className="App">
        Hello React !!!
      </div>
    );
  }
}

class FirstComponent extends Component{
  render(){
    return(
      <div className="App">
        First React Component
      </div>
    );
  }
}

export default App;
